  [],\n\t\"revision_timestamp\": \"2016-02-27T17:19:04.846551\",\n\t\"name\": \"numident-online-verification-utility-novu\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NOVU is a mainframe application that accesses
  the NUMIDENT to perform real-time SSN verifications. This program is called by other
  SSA online programs that serve as interfaces to end-users. Some of the systems that
  use NOVU for verification purposes include Social Security Number Verification Service
  (SSNVS), Social Security Online Verification (SSOLV) and State Online Query (SOLQ).
  The input record is passed to NOVU with the goal of verifying that the SSN is valid
  and the corresponding name, DOB and/or gender match with certain tolerances. The
  NOVU verification response codes are returned to the requester.\",\n\t\"license_title\":
